css:
.outline-view {
  display: flex;
  flex-direction: column;
  height: 100%;
  width: 100%;
}
.outline-view-core {
  display: flex;
  flex-direction: column;
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
  height: 100%;
  width: 100%;
}
.outline-view-trees-scroller {
  flex-grow: 1;
  overflow: auto;
}
.outline-view-item {
  padding: 0 5px;
}
.outline-view-trees {
  display: inline-block;
  min-width: 100%;
}
.outline-view-loading {
  margin: auto;
}
.outline-view-item {
  padding: 0 5px;
}
.panel-heading .outline-view-close-button {
  top: -0.25em;
}
.outline-view-search-bar {
  align-items: center;
  display: flex;
  flex: 0 0 auto;
  flex-direction: row;
  justify-content: space-between;
  margin: 5px;
  position: relative;
}
.outline-view-search-pane {
  flex-grow: 1;
}
.outline-view-search-clear {
  position: absolute;
  right: 0;
}
.outline-view-match {
  font-weight: bolder;
  filter: brightness(1.25);
}
